import React, {Component} from 'react';
import './../../styles/UserCard.css';

const UserCard = ({name, userType, prop}) => {

	gotodetails = event => {
    	prop.history.push('/UserDetails/'+ name);
  	};

    return (
        <div className='userCard' onClick = {gotodetails}>   
            <p>Name: {name}</p>
            <p>Role: {userType}</p>
        </div>
    );
}

export default UserCard;
